import React from "react";
import { Section } from "./Section";
import "./css/About.css";

const AboutSection = styled(Section)`
	.row {
		display: flex;
		height: fill;
	}
`;

export function About() {
	return (
		<Section title="About">
			<div className="row">
				<div className="column left">hi</div>
				<div className="column right">bye</div>
			</div>
		</Section>
	);
}
